// src/App.tsx
import { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Layout from "./pages/deposit"; // layoutul principal
import HomePage from "./pages/index";
import LoginPage from "./pages/LoginModal";
import RegisterModal from "./pages/RegisterModal";
import Profil from "./pages/profil"; // pagina de profil
import GamePage from "./pages/game"; // pagina de jocuri
import Tranzactii from "./pages/tranzactii"; // pagina de tranzacții

// Funcții false pentru modale (până când le gestionezi dintr-un context global)
const fakeOnClose = () => {};
const fakeIsOpen = true;

function App() {
  const [data, setData] = useState<string>("");

  useEffect(() => {
    fetch("https://localhost:5001/api/hello")
      .then((res) => res.json())
      .then((data) => setData(data.message))
      .catch((err) => console.error("API fetch error:", err));
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<HomePage />} />
          <Route path="login" element={<LoginPage onClose={fakeOnClose} />} />
          <Route path="register" element={<RegisterModal onClose={fakeOnClose} isOpen={fakeIsOpen} />} />
          <Route path="profile" element={<Profil />} />
          <Route path="games" element={<GamePage />} />
          <Route path="tranzactii" element={<Tranzactii />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
